const NewModifiedNavbar = () => {
  return (
    <>
      <nav className="navbar navbar-expand-md navbar-dark bg-dark">
        <div className="container bg-primary">
          <a className="nav"></a>
        </div>
      </nav>
    </>
  );
};

export default NewModifiedNavbar;
